using DdnsService.Config;
using DdnsService.Utils;
using System;
using System.Collections.Generic;
using System.Text;
using WithSalt.Common.Api.Email;

namespace DdnsService.ApiService
{
    class EmailNotice
    {
        public (bool, string) Send(string ip, string lastIp)
        {
            try
            {
                SendEmail email = new SendEmail(ConfigManager.Now.AppSettings.EmailApiConfig.Host
                    , ConfigManager.Now.AppSettings.EmailApiConfig.Account
                    , ConfigManager.Now.AppSettings.EmailApiConfig.Passwd
                    , ConfigManager.Now.AppSettings.EmailApiConfig.UseDefaultCredentials);
                bool result = email.SendHtmlMail($"[DDNS提示]IP地址已变更，变更IP：{ip}"
                    , ConfigManager.Now.AppSettings.EmailApiConfig.ReceiveAddress
                    , CreateEmailBody(ip, lastIp));
                return (result, "success");
            }
            catch (Exception ex)
            {
                return (false, $"邮件发送失败，{ex.Message}");
            }
        }

        private string CreateEmailBody(string ip, string lastIp)
        {
            string htmlBase64 = "";
            string html = Base64.Base64Decode(htmlBase64);
            if (string.IsNullOrEmpty(html))
            {
                throw new Exception("Decode HTML Base64 failed.");
            }
            return html.Replace("{ip}", ip).Replace("{lastip}", lastIp);
        }
    }
}
